DROP TABLE IF EXISTS `userreviewed`;
CREATE TABLE `userreviewed` (
  `review_id` int(11) NOT NULL AUTO_INCREMENT,
  `user_name` varchar(200) CHARACTER SET utf32 COLLATE utf32_german2_ci DEFAULT NULL,
  `user_rating` int(1) DEFAULT NULL,
  `user_review` text CHARACTER SET utf32 COLLATE utf32_german2_ci DEFAULT NULL,
  `datetime` int(11) DEFAULT NULL,
  `hostguest` tinyint(1) DEFAULT NULL,
  `party_id` int(11) DEFAULT NULL,
  `user_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`review_id`),
  KEY `party_id` (`party_id`),
  KEY `user_id` (`user_id`),
  CONSTRAINT `userreviewed_ibfk_3` FOREIGN KEY (`party_id`) REFERENCES `party` (`id`) ON DELETE SET NULL ON UPDATE SET NULL,
  CONSTRAINT `userreviewed_ibfk_4` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE SET NULL ON UPDATE SET NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_german2_ci;

