DROP TABLE IF EXISTS `users`;
CREATE TABLE `users` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `firstname` varchar(200) COLLATE utf8_german2_ci DEFAULT NULL,
  `lastname` varchar(200) COLLATE utf8_german2_ci DEFAULT NULL,
  `sex` char(1) COLLATE utf8_german2_ci DEFAULT NULL,
  `age` int(11) DEFAULT NULL,
