  `password` varchar(100) COLLATE utf8_german2_ci DEFAULT NULL,
  `drinks` char(1) COLLATE utf8_german2_ci DEFAULT NULL,
  `photo` blob DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_german2_ci;

